import {COUNTRIES_ROUTE, DEVICE_ROUTE,SHOP_ROUTE} from "./utils/consts";
import Shop from "./pages/Shop";
import DevicePage from "./pages/CountryPage";
import Countries from "./pages/Countries";

export const publicRoutes = [
    {
        path: SHOP_ROUTE,
        Component: Shop
    },
    {
        path: DEVICE_ROUTE + '/:id',
        Component: DevicePage
    },
    {
        path: COUNTRIES_ROUTE,
        Component: Countries
    },
]
